import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { DataService } from '../../services/data.service';
import { Router } from '@angular/router';

@Component({
    selector: 'app-interview-results',
    standalone: true,
    imports: [CommonModule],
    template: `
        <div class="results-container" *ngIf="dataService.evaluationResults">
            <!-- Interview Session Section -->
            <div class="interview-session">
                <h1>AI Interview Session</h1>
                <div class="question-progress">
                    <div class="progress-circle">3</div>
                    <div class="progress-bar"></div>
                    <div class="question-count">12/20 Questions</div>
                </div>
                <div class="question-box">
                    <div class="question">
                        <img src="assets/mic-icon.svg" alt="microphone" class="mic-icon">
                        <p>{{ lastQuestion }}</p>
                    </div>
                    <div class="answer">
                        <p>{{ lastAnswer }}</p>
                        <img src="assets/user-icon.svg" alt="user" class="user-icon">
                    </div>
                </div>
            </div>

            <!-- Final Evaluation Section -->
            <h2>Final Evaluation</h2>
            <div class="evaluation-grid">
                <!-- Analysis Summary -->
                <div class="analysis-card">
                    <h3>Analysis Summary</h3>
                    
                    <div class="strengths">
                        <h4>
                            <span class="plus-icon">+</span>
                            Strengths
                        </h4>
                        <ul>
                            <li *ngFor="let strength of dataService.evaluationResults.strengths">
                                {{ strength }}
                            </li>
                        </ul>
                    </div>

                    <div class="improvements">
                        <h4>
                            <span class="arrow-icon">→</span>
                            Areas for Improvement
                        </h4>
                        <ul>
                            <li *ngFor="let area of dataService.evaluationResults.areasForImprovement">
                                {{ area }}
                            </li>
                        </ul>
                    </div>
                </div>

                <!-- Final Decision -->
                <div class="decision-card">
                    <h3>Final Decision</h3>
                    
                    <div class="decision-status" 
                         [class.accepted]="dataService.evaluationResults.finalDecision.decision === 'Accepted'"
                         [class.rejected]="dataService.evaluationResults.finalDecision.decision === 'Rejected'">
                        {{ dataService.evaluationResults.finalDecision.decision }}
                    </div>

                    <div class="ratings">
                        <div class="rating-item">
                            <div class="rating-label">Technical Skills</div>
                            <div class="rating-stars">
                                <span *ngFor="let star of [1,2,3,4,5]" 
                                      [class.filled]="star <= dataService.evaluationResults.finalDecision.ratings['Technical Skills']">
                                    ★
                                </span>
                            </div>
                        </div>

                        <div class="rating-item">
                            <div class="rating-label">Cultural Fit</div>
                            <div class="rating-stars">
                                <span *ngFor="let star of [1,2,3,4,5]" 
                                      [class.filled]="star <= dataService.evaluationResults.finalDecision.ratings['Communication Skills']">
                                    ★
                                </span>
                            </div>
                        </div>

                        <div class="rating-item">
                            <div class="rating-label">Experience Level</div>
                            <div class="rating-stars">
                                <span *ngFor="let star of [1,2,3,4,5]" 
                                      [class.filled]="star <= dataService.evaluationResults.finalDecision.ratings['Experience Level']">
                                    ★
                                </span>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            <!-- Footer -->
            <div class="footer">
                <div class="logo">
                    <img src="assets/hire-ai-logo.svg" alt="HireAI">
                    HireAI
                </div>
                <div class="social-links">
                    <a href="#" target="_blank"><img src="assets/twitter.svg" alt="Twitter"></a>
                    <a href="#" target="_blank"><img src="assets/linkedin.svg" alt="LinkedIn"></a>
                    <a href="#" target="_blank"><img src="assets/github.svg" alt="GitHub"></a>
                </div>
            </div>
        </div>
    `,
    styles: [`
        .results-container {
            max-width: 1200px;
            margin: 40px auto;
            padding: 20px;
            color: white;
            font-family: 'Inter', sans-serif;
        }

        h1, h2 {
            color: white;
            text-align: center;
            margin-bottom: 30px;
        }

        .interview-session {
            background: #151e33;
            border-radius: 16px;
            padding: 24px;
            margin-bottom: 40px;
        }

        .question-progress {
            display: flex;
            align-items: center;
            margin: 20px 0;
        }

        .progress-circle {
            width: 40px;
            height: 40px;
            background: #2563eb;
            border-radius: 50%;
            display: flex;
            align-items: center;
            justify-content: center;
            font-weight: bold;
        }

        .progress-bar {
            flex: 1;
            height: 4px;
            background: #2563eb;
            margin: 0 15px;
        }

        .question-count {
            color: #94a3b8;
        }

        .question-box {
            background: #1e293b;
            border-radius: 12px;
            padding: 20px;
            margin-top: 20px;
        }

        .question, .answer {
            display: flex;
            align-items: flex-start;
            gap: 12px;
            margin: 10px 0;
        }

        .mic-icon, .user-icon {
            width: 24px;
            height: 24px;
        }

        .evaluation-grid {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 24px;
            margin-top: 30px;
        }

        .analysis-card, .decision-card {
            background: #1e293b;
            border-radius: 16px;
            padding: 24px;
        }

        h3 {
            color: white;
            margin-bottom: 20px;
            font-size: 1.25rem;
        }

        h4 {
            display: flex;
            align-items: center;
            gap: 8px;
            color: white;
            margin: 16px 0;
        }

        .plus-icon {
            color: #22c55e;
        }

        .arrow-icon {
            color: #f59e0b;
        }

        ul {
            list-style: none;
            padding: 0;
        }

        li {
            margin: 8px 0;
            padding-left: 24px;
            position: relative;
        }

        li:before {
            content: "•";
            position: absolute;
            left: 8px;
        }

        .decision-status {
            text-align: center;
            font-size: 24px;
            font-weight: bold;
            padding: 12px;
            border-radius: 8px;
            margin: 20px 0;
        }

        .decision-status.accepted {
            background: rgba(34, 197, 94, 0.2);
            color: #22c55e;
        }

        .decision-status.rejected {
            background: rgba(239, 68, 68, 0.2);
            color: #ef4444;
        }

        .ratings {
            display: flex;
            flex-direction: column;
            gap: 16px;
        }

        .rating-item {
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        .rating-stars {
            color: #64748b;
            font-size: 20px;
        }

        .rating-stars span.filled {
            color: #2563eb;
        }

        .footer {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-top: 40px;
            padding-top: 20px;
            border-top: 1px solid #334155;
        }

        .logo {
            display: flex;
            align-items: center;
            gap: 8px;
            font-weight: bold;
        }

        .social-links {
            display: flex;
            gap: 16px;
        }

        .social-links img {
            width: 24px;
            height: 24px;
            opacity: 0.7;
            transition: opacity 0.2s;
        }

        .social-links img:hover {
            opacity: 1;
        }
    `]
})
export class InterviewResultsComponent {
    lastQuestion: string = 'Can you describe a challenging project you\'ve worked on and how you handled it?';
    lastAnswer: string = 'In my last role, I led the development of a real-time analytics dashboard...';

    constructor(public dataService: DataService, private router: Router) {
        // Redirect to interview page if no results are available
        if (!this.dataService.evaluationResults) {
            this.router.navigate(['/ai-interview']);
        }
    }
} 
}
